import { Grid } from "@mui/material";
import React from "react";
import IntroduceText from "../../components/IntroduceText";

function Service() {
  return (
    <Grid
      container
      spacing={2}
      justifyContent="center"
      alignItems="center"
      mt={3}
    >
      <IntroduceText firstLine="파트너스" secondLine="서비스 소개" />
    </Grid>
  );
}

export default Service;
